    function taoh_articles_init (){
        var articles_list = $('.articles_list');
		loader(true, loaderArea);
		var data = {
			 'taoh_action': 'articles_get',
			 'ops': 'list',
			 'type': 'reads',
			 'mod': 'core',
             'category': category,
		 };
		jQuery.post("<?php echo $ajax_url; ?>", data, function(response) {
			res = response;
            <?php if(TAOH_INTAODB_ENABLE) { ?>
				indx_art_lp_list(res);
				if(!art_already_rendered){
					render_articles_grid_template(res, articles_list);
				}
			<?php }else{ ?>
				render_articles_grid_template(res, articles_list);
			<?php } ?>

			loader(false, loaderArea);
		}).fail(function() {
			loader(false, loaderArea);
	    	console.log( "Network issue!" );
	  })
	}

    function render_articles_grid_template(data, slot) {
		slot.empty();
		if(data.success === false ) {
			slot.append("<p>No data found!</p>");
			return false;
		}
		$.each(data.output, function(i, v){
            var prefix = '<?php echo TAOH_CDN_PREFIX ?>';
            if(v.blurb.image) {
                v.imgurl = v.blurb.image;
            } else {
                v.imgurl = prefix+"/images/igcache/"+encodeURIComponent(v.title)+"/900_600/blog.jpg";
            }
            slot.append(
				`<div class="col-lg-3 responsive-column-half">
                    <div class="card card-item hover-y">
                        <a href="<?php echo TAOH_TEMP_SITE_URL."/learning/blog/"; ?>${convertToSlug(v.title)}-${v.conttoken}" class="card-img">
                            <img class="lazy" src="${v.imgurl}" alt="${v.title}">
                        </a>
                        <div class="card-body pt-0">
                            <a href="#" class="card-link">${v.tags}</a>
                            <h5 class="card-title fw-medium"><a target="_blank" href="<?php echo TAOH_TEMP_SITE_URL."/learning/blog/"; ?>${convertToSlug(v.title)}-${v.conttoken}">${v.title}</a></h5>
                            <div class="media media-card align-items-center shadow-none p-0 mb-0 rounded-0 mt-4 bg-transparent">
                            <span class="blog-detail"><a target="_blank" href="<?php echo TAOH_TEMP_SITE_URL."/learning/blog/"; ?>${convertToSlug(v.title)}-${v.conttoken}">READ MORE <i class="la la-arrow-right ml-1"></i></a></span>
                        </div>
                    </div>
                </div>`);
		});
	}

    function indx_events_lp_list(eventlistdata){
			var event_taoh_data = { taoh_data:events_list_name,values : eventlistdata };
			let event_setting_time = new Date();
			event_setting_time = event_setting_time.setHours(event_setting_time.getHours() + 2);
			var event_setting_timedata = { taoh_ttl: events_list_name,time:event_setting_time };
			obj_data = { [dataStore]:event_taoh_data,[TTLStore] : event_setting_timedata };
			Object.keys(obj_data).forEach(key => {
			// console.log(key, obj_data[key]);
				IntaoDB.setItem(key,obj_data[key]).catch((err) => console.log('Storage failed', err));
			});
			return false;
		} // indexed db form submit

    function indx_jobs_lp_list(joblistdata){
        var job_taoh_data = { taoh_data:job_list_name,values : joblistdata };
        let job_setting_time = new Date();
        job_setting_time = job_setting_time.setHours(job_setting_time.getHours() + 2);
        var job_setting_timedata = { taoh_ttl: job_list_name,time:job_setting_time };
        obj_data = { [dataStore]:job_taoh_data,[TTLStore] : job_setting_timedata };
        Object.keys(obj_data).forEach(key => {
        // console.log(key, obj_data[key]);
            IntaoDB.setItem(key,obj_data[key]).catch((err) => console.log('Storage failed', err));
        });
        return false;
    } // indexed db form submit

    function indx_art_lp_list(artlistdata){
        var art_taoh_data = { taoh_data:art_list_name,values : artlistdata };
        let art_setting_time = new Date();
        art_setting_time = art_setting_time.setHours(art_setting_time.getHours() + 2);
        var art_setting_timedata = { taoh_ttl: art_list_name,time:art_setting_time };
        obj_data = { [store_name]:art_taoh_data,[TTLStore] : art_setting_timedata };
        Object.keys(obj_data).forEach(key => {
        // console.log(key, obj_data[key]);
            IntaoDB.setItem(key,obj_data[key]).catch((err) => console.log('Storage failed', err));
        });
        return false;
    } // indexed db form submit

    setInterval(function(){
        checkTTL(art_list_name,store_name);
        checkTTL(events_list_name,dataStore);
        checkTTL(job_list_name,dataStore);
    },10000);
